import React from "react";
import { useNavigate } from "react-router-dom";
import "./head.css";
import AccountCircleIcon from '@mui/icons-material/AccountCircle';

function Head(props) {
    const navigate = useNavigate();
    const location = useLocation();

    const [token, setToken] = useState();
    const [username, setUsername] = useState();


    useEffect(() => {
        // eslint-disable-next-line react-hooks/exhaustive-deps
        try {
            setToken(location.state.token);
            setUsername(location.state.formUserName);
        } catch (error) {
            navigate("/");
        }
    }, []);

    return (
        <header className="site-header">
                <div className="aa">
                    <h1 className="site-title">Lion Cars</h1>
                </div>
                <nav className="main-nav">
                    <ul>
                        <li><a onClick={() => navigate('/home')}>Home</a></li>
                        <li><a onClick={() => navigate('/home')}>Published Cars</a></li>
                        <li><a onClick={() => navigate('/about')}>About</a></li>
                    </ul>
                </nav>
                <div className="user">
                    <h2 className="user-name">Olá, Leão</h2>
                    <button className="user-button" type="button" onClick={() => navigate("/user")}>
                        <AccountCircleIcon />
                    </button>
                </div>
            </header>
    )
}

export default Head;
